import React, { useState } from "react";

const App = () => {
  const [graphName, setGraphName] = useState("");
  const [graph, setGraph] = useState("");
  const [triples, setTriples] = useState("");

  const handleCreate = async () => {
    await createGraph(graphName);
  };

  const handleRead = async () => {
    const result = await getGraph(graphName);
    setGraph(result);
  };

  const handleUpdate = async () => {
    await updateGraph(graphName, triples);
  };

  const handleDelete = async () => {
    await deleteGraph(graphName);
  };

  return (
    <div>
      <input
        type="text"
        value={graphName}
        onChange={(e) => setGraphName(e.target.value)}
      />
      <button onClick={handleCreate}>Create Graph</button>
      <button onClick={handleRead}>Read Graph</button>
      <button onClick={handleUpdate}>Update Graph</button>
      <button onClick={handleDelete}>Delete Graph</button>
      <textarea value={graph} readOnly></textarea>
      <textarea
        value={triples}
        onChange={(e) => setTriples(e.target.value)}
      ></textarea>
    </div>
  );
};

export default App;
